import React, {Component} from 'react';
import FetchOpenWeather from '../FetchOpenWeather/FetchOpenWeather'

export default class AirTemperature extends Component {
    constructor() {
        super()
        this.testTemp = test.testTemp;
    }
    componentDidMount() {
        this.testTemp = FetchOpenWeather(this.props.city)
    }
    render() {
        return(
            <div>{this.testTemp}</div>
        )
    }
}
